u53E3\u7684\u5168\u8DEF\u5F84\u540D\uFF0C\u540C\u65F6\u63A5\u53E3\u7684\u65B9\u6CD5\u540D\u548CSQL\u8BED\u53E5\u7684id\u4E00\u4E00\u5BF9\u5E94\u3002</li></ul><h3 id="\u4F7F\u7528mybatis\u7684mapper\u63A5\u53E3\u8C03\u7528\u65F6\u6709\u54EA\u4E9B\u8981\u6C42" tabindex="-1"><a class="header-anchor" href="#\u4F7F\u7528mybatis\u7684mapper\u63A5\u53E3\u8C03\u7528\u65F6\u6709\u54EA\u4E9B\u8981\u6C42" aria-hidden="true">#</a> \u4F7F\u7528MyBatis\u7684mapper\u63A5\u53E3\u8C03\u7528\u65F6\u6709\u54EA\u4E9B\u8981\u6C42\uFF1F</h3><ul><li>Mapper.xml\u6587\u4EF6\u4E2D\u7684namespace\u5373\u662Fmapper\u63A5\u53E3\u7684\u5168\u9650\u5B9A\u7C7B\u540D\u3002</li><li>Mapper\u63A5\u53E3\u65B9\u6CD5\u540D\u548Cmapper.xml\u4E2D\u5B9A\u4E49\u7684sql\u8BED\u53E5id\u4E00\u4E00\u5BF9\u5E94\u3002</li><li>Mapper\u63A5\u53E3\u65B9\u6CD5\u7684\u8F93\u5165\u53C2\u6570\u7C7B\u578B\u548Cmapper.xml\u4E2D\u5B9A\u4E49\u7684\u6BCF\u4E2Asql\u8BED\u53E5\u7684parameterType\u7684\u7C7B\u578B\u76F8\u540C\u3002</li><li>Mapper\u63A5\u53E3\u65B9\u6CD5\u7684\u8F93\u51FA\u53C2\u6570\u7C7B\u578B\u548Cmapper.xml\u4E2D\u5B9A\u4E49\u7684\u6BCF\u4E2Asql\u8BED\u53E5\u7684resultType\u7684\u7C7B\u578B\u76F8\u540C\u3002</li></ul><h3 id="mybatis\u52A8\u6001sql\u662F\u505A\u4EC0\u4E48\u7684-\u90FD\u6709\u54EA\u4E9B\u52A8\u6001sql-\u80FD\u7B80\u8FF0\u4E00\u4E0B\u52A8\u6001sql\u7684\u6267\u884C\u539F\u7406\u4E0D" tabindex="-1"><a class="header-anchor" href="#mybatis\u52A8\u6001sql\u662F\u505A\u4EC0\u4E48\u7684-\u90FD\u6709\u54EA\u4E9B\u52A8\u6001sql-\u80FD\u7B80\u8FF0\u4E00\u4E0B\u52A8\u6001sql\u7684\u6267\u884C\u539F\u7406\u4E0D" aria-hidden="true">#</a> MyBatis\u52A8\u6001sql\u662F\u505A\u4EC0\u4E48\u7684\uFF1F\u90FD\u6709\u54EA\u4E9B\u52A8\u6001sql\uFF1F\u80FD\u7B80\u8FF0\u4E00\u4E0B\u52A8\u6001sql\u7684\u6267\u884C\u539F\u7406\u4E0D\uFF1F</h3><p>Mybatis\u52A8\u6001sql\u53EF\u4EE5\u8BA9\u6211\u4EEC\u5728xml\u6620\u5C04\u6587\u4EF6\u5185\uFF0C\u4EE5\u6807\u7B7E\u7684\u5F62\u5F0F\u7F16\u5199\u52A8\u6001sql\uFF0C\u5B8C\u6210